public class Main2 {
    public boolean isSubsequence(String s, String t) {
        if (s.isEmpty())
            return true;
        if (t.isEmpty())
            return false;

        int index = 0;

        for (int i = 0; i < t.length(); i++) {
            char c = t.charAt(i);

            if (c == s.charAt(index))
                index++;

            if (index == s.length())
                return true;
        }

        return false;
    }

    public static void main(String[] args) {
        Main2 m = new Main2();
        String s1 = "abc", t1 = "ahbgdc";
        String s2 = "axc", t2 = "ahbgdc";
        String s3 = "", t3 = "ahbgdc";
        String s4 = "aaaaaa", t4 = "bbaaaa";
        String s5 = "leeeeetcode", t5 = "";

        System.out.println(m.isSubsequence(s1, t1));
        System.out.println(m.isSubsequence(s2, t2));
        System.out.println(m.isSubsequence(s3, t3));
        System.out.println(m.isSubsequence(s4, t4));
        System.out.println(m.isSubsequence(s5, t5));
    }
}
